SELECT MIN("dobito"."client_id") as agg_0 FROM "probehnuto" LEFT OUTER JOIN "client" ON "probehnuto"."client_id" = "client"."client_id" LEFT OUTER JOIN "probehnuto_mimo_penezenku" ON "client"."client_id" = "probehnuto_mimo_penezenku"."client_id" LEFT OUTER JOIN "dobito" ON "client"."client_id" = "dobito"."client_id"  WHERE "dobito"."month_year_datum_transakce" LIKE '%2013-10-0%1%' AND "probehnuto_mimo_penezenku"."Month/Year" NOT LIKE '%2013-11-01%' AND "client"."kraj" NOT LIKE '%Karlovarsk√Ω%' AND ("client"."client_id" <= 425941 OR "client"."client_id" BETWEEN 96285 AND 3825785 OR "client"."client_id" >= 9765993)